import React from 'react'
import '../styles/studentSignUp.css'
import NavBar from '../components/navBar.jsx'
import { useNavigate } from 'react-router-dom'

function StudentSignUp() {

    const navigate = useNavigate()
    const inputs = [
        {
            type:"text",
            id: "fName",
            name: "fName",
            label:"First Name",
        },

        {
            type:"text",
            id: "lName",
            name: "lName",
            label:"Last Name",
        },

        {
            type:"email",
            id: "email",
            name: "email",
            label:"E Mail",
        },

        {
            type:"password",
            id: "password",
            name: "password",
            label:"Password",
        },

        {
            type:"password",
            id: "conformPassword",
            name: "conformPassword",
            label:"Conform Password",
        },

    ]
  return (
    <div>

        <div className="nav">
            <NavBar/>
            <hr />
        </div>

        <div className="container">
            <div className="content">
                <h1>Create your account</h1>
                <h2>And get more options</h2>
            </div>
            <div className="form">
            {inputs.map((item,index) => {
                    return(
                        <ul>
                            <li>
                                <div className="inputBox">
                                    <input key = {index} type={item.type} id={item.id} name={item.name} />  
                                    <label htmlFor="">{item.label}</label>
                                </div>
                                
                            </li>
                        </ul>
                        
                    )
                })}

                {/* <p>Do you have account. <a href="#">SignIn</a></p> */}

                <button>SignUp</button>
            </div>
        </div>

       
    
        </div>
  )
}

export default StudentSignUp
